import React from 'react';
import logo from './logo.svg';
import './App.css';

import {BrowserRouter,Route} from "react-router-dom"

function App() {
    return (
        <BrowserRouter>
            <div className="App">
                <h1>Md Sohrab Hossain Sohel</h1>
                <Route path="/" render={()=>{
                    return <h1>Hellow I am Home Route</h1>
                }}/>





            </div>
        </BrowserRouter>
    );
}

export default App;
